import React from 'react';

const Signin = () => {
  return (
    <div>
      <div class="card">
        <h2>Instagram</h2>

        <input type="text" placeholder="email" />

        <input type="text" placeholder="password" />

        <button
          class="btn waves-effect waves-light"
          type="submit"
          name="action"
        >
          Submit
          <i class="material-icons right">send</i>
        </button>
      </div>
    </div>
  );
};

export default Signin;
